import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';
import {DropdownButton, Dropdown} from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';

import AboutUsPage from "../Pages/About_Us/AboutUsPage";
import HomePage from "../Pages/Home/HomePage";
import ContactPage from "../Pages/Contact/ContactPage";
import LoginPage from "../Pages/Login/LoginPage";
import DigitalPathologySolutionsPage from "../Pages/Services/DigitalPathologySolutionsPage";
import DiagnosticCardiologySolutionsPage from "../Pages/Services/DiagnosticCardiologySolutionsPage";
import DiagnosticRadiologySolutionsPage from "../Pages/Services/DiagnosticRadiologySolutionsPage";

import * as NavigationLinks from "./NavigationLinks";

class TopNavigationBar extends Component {
    render() {
        return (
            <Router>
                <div>
                    <nav>
                        <ul>
                            <li><Link to="/">HOME</Link></li>
                            <li><Link to="/aboutus">ABOUT US</Link></li>
                            <li>
                                <ServiceDropDownMenu/>
                            </li>
                            <li><Link to="/contact">CONTACT</Link></li>
                            <li><Link to="/login">Log In</Link></li>
                        </ul>
                    </nav>
                    <Switch>
                        {NavigationLinks.mainPageLinks.map(link => (<Route exact path={link.endpoint} component={link.page}/>))}
                    </Switch>
                </div>
            </Router>
        );
    }
}

class ServiceDropDownMenu extends Component {
    render() {
        return (
            <DropdownButton title="Services">
                {NavigationLinks.serviceDropDownMenuPageLinks.map(link => (<Dropdown.Item href={link.endpoint}>{link.name}</Dropdown.Item>))}
            </DropdownButton>
        );
    }
}

export default TopNavigationBar;
